import React from "react";
import tickets from "./ticket-data.json";
import Headers from "./table_headers.json";
import { Fragment } from "react";
import TicketRow from "../components/TicketRow";
import UserDataContext from "./context";
import { Navigate } from "react-router-dom";

class Tickets extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            open: tickets,
            resolved: tickets,
            loaded: false
        }
    }

    handleFetchTickets(filter) {
        var ticketPage = this;
        var url = "https://www.students.cs.ubc.ca/~shasan01/sql_commands.php";
        var formData = new FormData();
        formData.append("getTickets", filter);
        formData.append("departments", this.context.departments);

        const requestOptions = {
            method: "POST",
            body: formData,
        };

        fetch(url, requestOptions)
            .then(function (response) {
                return response.text();
            })
            .then(function (body) {
                console.log(body);
                if (body) {
                    const body_json = JSON.parse(body);
                    if (filter === "=") {
                        ticketPage.setState({resolved: body_json});
                    } else {
                        ticketPage.setState({open: body_json});
                    }
                }
            })
    }

    handleViewTicketResources = (ticket) => {
        var ticketPage = this;
        var url = "https://www.students.cs.ubc.ca/~shasan01/sql_commands.php";
        var formData = new FormData();
        formData.append("viewTicketInfo", ticket.TICKET_NUMBER);

        const requestOptions = {
            method: "POST",
            body: formData,
        };

        fetch(url, requestOptions)
            .then(function (response) {
                return response.text();
            })
            .then(function (body) {
                console.log(body);
                // TODO: add query to popup
                // NOTE: can return an empty list
            })
    }

    handleResolveTicket = (ticket) => {
        var ticketPage = this;
        var url = "https://students.cs.ubc.ca/~shasan01/sql_commands.php";
        var formData = new FormData();
        formData.append("resolveTicket", ticket.TICKET_NUMBER);
        var date = Date();
        console.log(date);
        // TODO: Get the current date
        formData.append("dateResolved", "2022-11-05")

        const requestOptions = {
            method: "POST",
            body: formData,
        };

        fetch(url, requestOptions)
            .then(function (response) {
                return response.text();
            })
            .then(function (body) {
                console.log(body);
                window.location.replace("http://localhost:3000/tickets");
            })

    }

    handleSortTickets = (event) => {
        event.preventDefault();
        console.log("Sorting by " + event.target.value);
    }

    render() {
        if (!this.state.loaded) {
            this.handleFetchTickets("=");
            this.handleFetchTickets("<>");
        }
        if (!this.context.authenticated) {
            return <Navigate to='/' />
        }
        return (
            <div class="container-fluid">
                <div class="row">
                    <h1>Open Tickets</h1>
                </div>
                <div class="mt-2 bg-light round">
                    <div class="px-3 mt-3 mb-3">
                        <table>
                            <tr>
                                {
                                    Object.keys(this.state.open[0]).map((heading) => (
                                        <th>{Headers[heading]}</th>
                                    ))
                                }
                            </tr>
                            {
                                this.state.open.map((ticket) => (
                                    <Fragment>
                                        <TicketRow ticket={ticket} handleViewTicketResources={this.handleViewTicketResources} handleResolveTicket={this.handleResolveTicket}/> 
                                    </Fragment>
                                ))
                            }
                        </table>
                    </div>
                </div>
                <h1>Resolved Tickets</h1>
                <div class="mt-2 bg-light round">
                    <div class="px-3 mt-3 mb-3">
                        <table>
                            <tr>
                                {
                                    Object.keys(this.state.resolved[0]).map((heading) => (
                                        <th>{Headers[heading]}</th>
                                    ))
                                }
                            </tr>
                            {
                                this.state.resolved.map((ticket) => (
                                    <Fragment>
                                        <TicketRow ticket={ticket} handleViewTicketResources={this.handleViewTicketResources}/> 
                                    </Fragment>
                                ))
                            }
                        </table>
                    </div>
                </div>
            </div>
        );
    }
}
Tickets.contextType = UserDataContext;

export default Tickets;
